import React from 'react'
import Brand from '../logo/Brand'

const Navbar = props => {

    let content = (
        <div className="container flex h-8 w-full bg-xw-100">
            <Brand className="align-middle ml-2"/>
        </div>
    )

    return content
}

export default Navbar
